I stopped using the 12-469&#39;s  for a couple days. I was getting a lot of interference and then finally they told me my method sucked. This is not the first time because some of them like other methods besides the ones we like. Anyways, I did a few water recordings yesterday and got a few things for Sumption and possibly others. Let me know if anything rings a bell. Also, because of the nature of the recordings (they are soft) headphones may make it easier to hear.

Regards,

Frank R.




